details:
 The program design created by ASPIRA as the service delivery model for all of our programs incorporates a Community and Youth Development framework which consist of the fundamental key elements of positive youth development principles and the Ten Essential Elements of High-Quality Out-of-School Time activities. www.afterschoolalliance.org

Our program model is based on research driven longitudinal studies and offers:

    Students a wide range of enrichment opportunities both in academic core subjects and in enrichment areas such as the arts and sports;
    Incorporate active learning in mathematics and literacy;
    Include opportunities for students to socialize in a safe and non-judgemental environment;
    Are staffed by experienced and trained leadership and employees;
    Involve students’ parents and school-day teachers.

Unmatched standards of education and nurturance. 
Unparalleled service to children and families.
Uncompromising excellence and partnership.

Stepping Stone School believes in integrating and balancing knowledge with creativity; daily details with greater vision; technology with imagination; challenge with support; belonging with individuality; hugs with high-fives. We integrate and balance little victories with lifelong success.

So we provide developmentally appropriate early care and education designed to help young children grow into school-readiness – academically, socially, emotionally and physically – through a welcoming atmosphere, warm relationships, lower ratios, leading-edge curriculum and family service in the Austin, Round Rock, and College Station neighborhoods.

At Stepping Stone School, our promise to children is to prepare them for school by giving them a learning environment where they feel:
    cared for and cared about;
    safe and secure;
    connected and engaged;
    calm and confident;
    smart and resourceful; and
    successful every day.

Likewise, our promise to parents is to strengthen their families by offering a stable, supportive partnership that delivers:
    trust and integrity;
    comfort and ease;
    happiness and help; and
    peace of mind and heart every day.

Our Future Child Care & Our Future Child Care Center

aims to provide quality care,
early childhood development and readiness;

is First AID/CPR Certified;

maintains Medical Certification;

is Delaware Stars Level 5;

Willamette Valley Christian School exists:
To provide students with a Christ-centered education that maintains high academic standards in a safe nurturing environment;
To partner with parents in the training and education of their children;
To provide students with the spiritual and educational foundations that will enable them to be godly, knowledgeable, and courageous adults; and 
To equip students to impact their world for Christ.
